use std::collections::HashMap;

use base64::prelude::*;
use rand_mt::Mt64;
use tracing::{info, instrument, trace};

use crate::network::bytes_as_hex;

use anyhow::{bail, Context, Result};

#[instrument(skip_all)]
pub fn decrypt_command(key: &[u8], encrypted: &mut [u8]) {
    trace!(data = bytes_as_hex(encrypted), "before decryption");

    for i in 0..encrypted.len() {
        encrypted[i] ^= key[i % key.len()];
    }

    trace!(data = bytes_as_hex(encrypted), "after decryption");
}

pub fn lookup_initial_key(initial_keys: &HashMap<u32, Vec<u8>>, bytes: &[u8]) -> Result<Vec<u8>> {
    let version = u32::from_be_bytes(
        bytes
            .get(..4)
            .context("failed to get version's bytes")?
            .try_into()?,
    ) ^ 0x9D74C714;

    {
        if let Some(x) = initial_keys.get(&version).map(|k| k.to_vec()) {
            info!(version, "found initial decryption key");
            return Ok(x);
        }
    }

    'a: {
        let b64 = match version {
            2648100823 => "",
            2224474369 => "",
            392989049 => "",
            2142109362 => "",
            2069501919 => "",
            2755164105 => "",
            1207755620 => "",
            1185629493 => "",
            315284530 => "",
            2380768206 => "",
            _ => break 'a
        };
        let key = BASE64_STANDARD.decode(b64)?.to_vec();
        info!(version, "found initial decryption key");
        return Ok(key);
    }

    bail!("unknown key for version {version}")
}

pub fn new_key_from_seed(seed: u64) -> Vec<u8> {
    // mersenne twister generator
    let mut gen = Mt64::new(seed);

    let mut key = Vec::with_capacity(512);
    for _ in 0..512 {
        for b in gen.next_u64().to_be_bytes() {
            key.push(b);
        }
    }
    key
}
